import 'bootstrap/dist/css/bootstrap.css';
import './Landing.css';
import logo from './images/Frame.png';
import spark from './images/Burst-pucker-1.png';
import redSymbol from './images/Burst-Bloat.png';
import spiral from './images/LooperGroup.png';
import pt from './images/Topology-2.png';
import rt from './images/Topology-1.png';

const LandingPage = () => {
  const containerStyle = {
    maxWidth: '375px', /* iPhone width */
    margin: '0 auto', /* Center the content horizontally */
    backgroundColor: '#f7f3f0', /* Optional: Set a background color */
  };
  return (
    <div style={containerStyle}>
      <header className="App-header">
      <div style={{  top: '0px', left: '92px' }} className="background-image"> <img src={spiral} alt="spiral" /> </div>
      <div style={{  top: '60px', left: '0px' }} className="background-image"><img src={logo} style={{ height: '70px' }} alt="Logo" /> </div>
      <div style={{ height: '10px' }}></div> {/* Empty vertical box */}
      <div style={{  top: '222px', left: '-120px' }} className="background-image"> <img src={spark} style={{ height: '70px' }} alt="spark" /> </div>
      <div className="inner-container">
        <span className="text-left">Welcome to</span>
        <div style={{ height: '1px' }}></div> {/* Empty vertical box */}
        <span className="text-right">traveleress</span>
      </div>
      
      <div style={{  top: '600px', left: '-110px'}} className="background-image"> <img src={redSymbol} alt="redSymbol" /> </div>
      <div>
      <div style={{ height: '100px' }}></div> {/* Empty vertical box */}
      <div className="button">Let's explore </div> 
      <div style={{ height: '35px' }}></div> {/* Empty vertical box */}
      <p style={{ fontSize: '15px' }}> or </p>
      <div style={{ height: '30px' }}></div> {/* Empty vertical box */}
      <div className="button">Meet up! </div> 
      <div style={{  top: '300px', left: '65px'}} className="background-image"> <img src={pt} alt="pt" /> </div>
      </div>

      
        
      </header>

    </div>
  );
}

export default LandingPage;
